import React from "react";
import Particles from "react-particles-js";
import "./App.css";

import Essentials from "./context/Essentials";
import ProjectsContext from "./context/ProjectsContext";
// COMPONENTS
import Components from "./components";

// FUNCTIONS
function App() {
  return (
    <>
      <Particles
        params={{
          particles: {
            number: {
              value: 200,
              density: {
                enable: true,
                value_area: 1000,
              },
            },
          },
        }}
      />
      <Essentials>
        <ProjectsContext>
          <Components />
        </ProjectsContext>
      </Essentials>
    </>
  );
}

export default App;
